INSERT INTO `v1_54bae8dc1b7b4b633aca33106bb1c2546a5ce0fdfd7624bf9244532f32e88992` VALUES (11, 10, 0, 0, "どうしたんだ、ユイ？\nあいつのために\nわざわざ弁当作ってきたんだろ？\nとっとと誘えばいいじゃないか。", 1, 110411, 0, 1, 945, 19450021);
INSERT INTO `v1_54bae8dc1b7b4b633aca33106bb1c2546a5ce0fdfd7624bf9244532f32e88992` VALUES (91, "", "", "", "", "", 0, "", "", 945, 19450022);
